import styled from "styled-components";

export const CustomInput = styled.div`
display: flex;
width: 100%;
height: 36px;
background-color: white;
flex-wrap: wrap;

>input{
    font-size: 14px;
    font-family: "Roboto";
    width: 100%;
    height: 100%;
    border-radius: 6px;
    box-shadow: none;
    border: .7px solid #A3A3A3;
}
`
export const Label = styled.label`
width: 100%;
font-size: 18px;
font-family: "Roboto-Medium";
text-align: start;
margin-bottom: 6px;
`
